import React, {Component} from "react";

class InformationSection extends Component {
    render () {
        return (
            <div className = "informationSection">
                <h1>Try us out for free for an entire week!</h1>
                <style jsx>{`
                    .informationSection {
                        background-size: cover;
                    }

                    .signUpBar h1 {
                        font-family: Lato;
                        font-weight: 900;
                        margin:0;
                        color: white;
                        font-size: 50px;
                        text-align: center;
                        padding-top: 10px;
                        padding-bottom: 20px;   
                        vertical-align: middle;
                        font-size: 5vh;
                    }
                `}</style>
            </div>
        );
    }
}

export default InformationSection;
